import React from 'react'

export const Ticket = ({allTickets,onDelete}) => {
    return (
        <div>
            <h4>{allTickets.title}</h4>
            <p>{allTickets.description}</p>
            <button className="btn btn-sm btn-danger" onClick={onDelete}>Delete</button> 
        </div>
    )
}
